import React from 'react';

const Cafe = () => {
return (
	<div>
	    <table>
	        <tr>
	            <td><img src="/Images/FoodBurger.jpg" /></td>
	            <td><img src="/Images/FoodCola.jpg" /></td>
	            <td><img src="/Images/FoodPopcorn.jpg" /></td>
	        </tr>
	        <tr>
	            <td>$7.50</td>
	            <td>$4.50</td>
	        	<td>$5.0</td>
	        </tr>
	    </table>
	</div>
);
};

export default Cafe;
